  overflow: hidden;
  width: 960px;
  margin: 0 auto;
  height: 300px;
`;
export const HomeLeft = styled.div`
  width: 625px;
  float: left;
  margin-left: 15px;
  padding-top: 30px;
`;
export const HomeRight = styled.div`
  width: 240px;
  float: right;
`;
